First, let's list out the prime factors of 500: \[
\begin{array}{c}
\{2,5\} \\
\end{array}
\] Now, using exponent notation, write each possible product as powers of primes multiplied together. \[\begin{aligned} & {1}=2^{0}\times{}5^{0}\\ & {2=2^{1}\times{}5^{0}}\\ & {5=2^{0}\times{}5^{1}}\\ & {10=2^{1}\times{}5^{1}}\\ & {25=2^{0}\times{}5^{2}}\\ & {50=2^{1}\times{}5^{2}}\\ & {100=2^{2}\times{}5^{2}}\\ & {250=2^{1}\times{}5^{3}}\\ & {500=2^{2}\times{}5^{2}}. \end{aligned}\] Note that when considering combinations, order doesn't matter; so $[1]$ appears twice because it comes once counting odd exponents first, but also counts again later due to even ones -- you don’t add duplicates

